	$(document).ready(function() {
		// Recalculate top position on window resize and scroll
		$(window).on('resize scroll', function() {
			calculateSidebarTop();
		});
	
		// Function to calculate and set the top position of the sidebar
		function calculateSidebarTop() {
			var header = $(".main-header");
			var headerHeight = header.outerHeight();
			var pageScrollMenuHeight = $(".page-scroll-menu").outerHeight() || 0;
			var sidebar = $(".beside-main .sidebar");
			var windowHeight = $(window).height();
			var scrollTop = $(window).scrollTop();
			var headerOffsetTop = header.offset().top;
	
			// Get the last element's position
			var lastElement = $(".last-element");
			var lastElementPosition = lastElement.offset().top + lastElement.outerHeight();
	
			// Calculate the maximum top position for the sidebar
			var maxTopPosition = header.hasClass('sticky') ? headerHeight + 30 : headerOffsetTop + headerHeight + 30;
	
			// Calculate top position
			var topPosition = 30;
	
			if (scrollTop + windowHeight >= lastElementPosition) {
				// Stick sidebar to the bottom of the page when it hits the last element
				topPosition = lastElementPosition - sidebar.outerHeight() - scrollTop;
			} else {
				topPosition = Math.min(maxTopPosition, Math.max(scrollTop + headerHeight + pageScrollMenuHeight, headerOffsetTop + headerHeight));
			}
	
			// Set the top position of the sidebar
			sidebar.css("top", topPosition);
		}
	
		// Initial calculation of the top position
		calculateSidebarTop();
	});
	
//Sticky element selector..
const stickyElement = document.querySelector(`[data-sticky="true"]`);

// Calculate the height of the sticky header
const headerHeight = document.querySelector('header').offsetHeight;

//..and other constants
const startPosition = stickyElement.getBoundingClientRect().top;

//Variables
let endScroll = window.innerHeight - stickyElement.offsetHeight - 500,
    currPos = window.scrollY,
    screenHeight = window.innerHeight,
    stickyElementHeight = stickyElement.offsetHeight,
    topGap = 0,
    bottomGap = 0;

//Set Gaps
setTimeout(() => {
    if (stickyElement.hasAttribute(`data-top-gap`)) {
        const dataTopGap = stickyElement.getAttribute(`data-top-gap`);
        topGap = String(dataTopGap) == "auto" ? startPosition : parseInt(dataTopGap);
    }

    if (stickyElement.hasAttribute(`data-bottom-gap`)) {
        bottomGap = parseInt(stickyElement.getAttribute(`data-bottom-gap`));
    }
}, 100);

//Add required style to sticky element
stickyElement.style.position = `sticky`;
stickyElement.style.top = topGap + headerHeight + `px`;
stickyElement.style.height = "fit-content";

//Main function
function positionStickySidebar() {
    endScroll = window.innerHeight - stickyElement.offsetHeight - bottomGap;
    let stickyElementTop = parseInt(stickyElement.style.top.replace(`px;`, ``));
    if (stickyElementHeight + topGap + bottomGap > screenHeight) {
        if (window.scrollY < currPos) {
            //Scroll up
            if (stickyElementTop < topGap) {
                stickyElement.style.top = (stickyElementTop + currPos - window.scrollY) + `px`;
            } else if (stickyElementTop >= topGap && stickyElementTop != topGap) {
                stickyElement.style.top = topGap + `px`;
            }
        } else {
            //Scroll down
            if (stickyElementTop > endScroll) {
                stickyElement.style.top = (stickyElementTop + currPos - window.scrollY) + `px`;
            } else if (stickyElementTop < (endScroll) && stickyElementTop != endScroll) {
                stickyElement.style.top = endScroll + `px`;
            }
        }
    } else {
        stickyElement.style.top = topGap + `px`;
    }
    currPos = window.scrollY;
}

function stickyElementToMe() {
    stickyElement.style.top = topGap + `px`;
}

function updateSticky() {
    screenHeight = window.innerHeight;
    stickyElementHeight = stickyElement.offsetHeight;
    positionStickySidebar();
}

setTimeout(() => {
    //Check heights of the viewport and the sticky element on window resize and reapply positioning
    window.addEventListener(`resize`, () => {
        currPos = window.scrollY;
        updateSticky();
    });
    //Follow the main function when scrolling
    document.addEventListener(`scroll`, updateSticky, {
        capture: true,
        passive: true
    });
}, 1000);

