/* Match height */
function sameHeight(elem, heightType) {
	var mhelem = $(elem);
	var maxHeight = 0;
	if (heightType == undefined) {
		heightType = 'min-height';
	} else {
		heightType = 'height';
	}
	mhelem.css(heightType, 'auto');
	mhelem.each(function () {
		if ($(this).height() > maxHeight) {
			maxHeight = $(this).height();
		}
	});
	mhelem.css(heightType, maxHeight);
}

// on click scroll to related id
function updateNavigation() {
    contentSection.each(function() {
        var sectionName = $(this).attr('id');
        var navigationMatch = $('.menu-scroll a[href="#' + sectionName + '"]');
        if (($(this).offset().top - $(window).height() / 2 < $(window).scrollTop()) &&
            ($(this).offset().top + $(this).height() - $(window).height() / 2 > $(window).scrollTop())) {
            navigationMatch.parent().addClass('active');
        } else {
            navigationMatch.parent().removeClass('active');
        }
    });
}

function smoothScroll(target) {
	if($('.main-header').hasClass('sticky')) {
		$('body,html').animate({
			scrollTop: target.offset().top - headerHeight - 30
		}, 500, 'linear');
	} else {
		$('body,html').animate({
			scrollTop: target.offset().top - headerHeight - 80
		}, 500, 'linear');
	}
}

